import React from "react";
import { Button, Card, CardContent, Input, InputLabel, Typography, TextField } from "@material-ui/core"

function CreatePost() {
    return (
    <Card>
        <CardContent>
            <Typography variant="h4" align="center">
                Create a post
            </Typography>
            <InputLabel align="center">Title: </InputLabel>
            <Input placeholder="Title..." align="center"></Input>
            <InputLabel>Post: </InputLabel>
            <TextField multiline="true"></TextField>
        </CardContent>
        <Button> Submit </Button>
    </Card>
    );
}

export default CreatePost;
